import style from './contents.module.css'
import React, { Fragment } from 'react';

export default function Content() {
  return (
    <>
      <h1>React</h1>
      <h2>사용자 인터페이스를 만들기 위한 JavaScript 라이브러리</h2>
      <br/>
      <input type="submit">시작하기</input>
    </>
  )
}
